import React from "react";
import styled from "styled-components";
import { SPACING } from "./Global Styles/styles";

const TagArea = styled.div`
    margin: ${SPACING.xtiny} ${SPACING.tiny} ${SPACING.xtiny} ${SPACING.tiny};
`;

const Tag = () => {
    return(
        <TagArea></TagArea>
    );
}

export default Tag;
